import React from "react";
import { makeStyles, Typography, Card, CardContent } from "@material-ui/core";

import styles from "../styles/SurveyCardStyle";


const useStyles = makeStyles(styles);

function SurveyCard() {

  const classes = useStyles();

  
  return (
    <React.Fragment>
      <Typography>This is SurveyCard</Typography>
      <Card md={8} lg={8}>
        <CardContent >
          <Typography variant="h4">Title: </Typography>  
          <Typography variant="h4">Survey Demo 1</Typography>      
        </CardContent>
      </Card>
    </React.Fragment>
  )


}

export default SurveyCard;
